                new Question(){Title="Aynı türe ait iki bireyin metabolizma hızlarının farklılığına,I.yaş, II.cinsiyet, III.vücut büyüklüğü faktörlerinden hangileri neden olabilir?",Answer = "I, II ve III",ChoiceOne = "II ve III",ChoiceTwo = "I ve II",ChoiceThree = "Yalnız II",ChoiceFour = "Yalnız I",AddedTime = DateTime.Now,CategoryId = 4,TeacherId = 1,Picture = null},
