                new Question(){Title="Yahya Kemal ile ilgili olarak aşağıdakilerden hangisi yanlıştır?",Answer = "Sanat yaşamına şiirle başlamış, şiirle devam etmiş, düzyazı türünde eser vermemiştir.",ChoiceOne = "Şiirin düzyazıdan farklı, musikiden başka türlü bir musiki olduğunu söyleyerek, şiirin düzyazıdan uzaklaştırılması gerektiğini savunmuştur.",ChoiceTwo = "Şiirlerinde, Türk tarihinin, sanatının başarılı geçmişini ve bunlar karşısındaki kişisel duygularını dile getirmiştir.",ChoiceThree = "Ölçünün bir araç olduğunu savunmuş, 'Ok' dışındaki bütün şiirlerini aruzla yazmıştır",ChoiceFour = "Klasik Türk edebiyatı olarak gördüğü Divan şiirini örnek alarak gazeller, şarkılar, rubailer yazmıştır.",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Reşat Nuri'nin, toplumumuzun en çalkantılı döneminde yazdığı —- adlı romanının kahramanı —-, Özgür ruhlu, cesur bir kızdır. Türk toplumu Batı uygarlığına yönelmemiş olsaydı, onun kişiliğinde modern, Batı eğitimi görmüş, aynı zamanda tertemiz genç kız tipini benimseyebilir miydi? Bu parçada boş bırakılan yerlere aşağıdakilerden hangisi getirilebilir?",Answer = "Çalıkuşu'nun – Feride",ChoiceOne = "Kızılcık Dalları'nın – Gülsüm",ChoiceTwo = "Eski Hastalık'ın -Züley",ChoiceThree = "Acımak'ın – Zehra",ChoiceFour = "Dudaktan Kalbe'nin – Lamia",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Aşağıdakilerden hangisi farklı bir yazara aittir?",Answer = "Türkçe Şiirler",ChoiceOne = "Malta Mektupları",ChoiceTwo = "Kızıl Elma",ChoiceThree = "Altın Işık",ChoiceFour = "Türkçülüğün Esasları",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Biri boğazı sahiplenmişti, öteki nerede olduğunu bilmediğimiz bir golün kıyısında bütün insanları unutuyordu. Biri 'Körfezdeki dalgın suyun, derinliklerinde geçmişin güzelliklerini görürken' Öteki, gol kıyısına bağdaş kurup oradaki kamışlara imreniyor; onlardan biri olmak istiyordu. İkisi de aruzla yazıyor ve şiirin müziğini duyurmaya çalışıyordu. Bu parçada sözü edilen şairler aşağıdakilerin hangisinde bir arada verilmiştir?",Answer = "Yahya Kemal, Ahmet Haşim",ChoiceOne = "Melih Cevdet Anday, Behçet Necatigil",ChoiceTwo = "Fazıl Hüsnü Dağlarca, Cahit Külebi",ChoiceThree = "Faruk Nafiz Çamlıbel, Ziya Osman Saba",ChoiceFour = "Tevfik Fikret, Oktay Rifat",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Büyük konak ve yalılarda yaşayan insanlardan en kenar mahallelerde yaşayan yoksul halka kadar, paşası, efendisi, hanımı, küçük beyi, mürebbiyesi, doktoru, hacısı, hocası, küçük memuru, tulumbacısı, dilencisi ile İstanbul İnsanları, giyimleri, gelenekleri, görenekleri, düşünceleri, inançları, konuşma, biçimleriyle onun romanlarında yaşar. Altmış, yetmiş yıl önceki İstanbul'un atlı tramvayları, Kâğıthane âlemleri, Ramazan aylarında Şehzadebaşı gezmeleri bütün canlılığıyla işlenmiştir. Onun romanlarını 'töre romanı' saydıran da işte bu özellikleridir. Bu parçada romanlarının içeriğinden söz edilen yazar aşağıdakilerin hangisidir?",Answer = "Hüseyin Rahmi Gürpınar",ChoiceOne = "Reşat Nuri Güntekin",ChoiceTwo = "Yakup Kadri Karaosmanoğlu",ChoiceThree = "Refik Halit Karay",ChoiceFour = "Ahmet Hamdi Tanpınar",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Milli Edebiyat döneminden itibaren, romanlarda güçlü kadın kahramanlara rastlıyoruz: İzmir'de, Yunan işgali sırasında eşini ve çocuğunu kaybeden ve Anadolu'ya geçerek ölümü göze alan Ayşe; kendini Anadolu'daki çocuklara adayan Feride, yine Anadolu'da öğretmenlik yapan ve Kuvay-ı Milliye karşıtı yobaz kasabalılar tarafından Öldürülen Aliye, Cumhuriyet'in yirminci yılında başkentin yaşamını yansıtan romanda toplumsal ortamın renklenmesiyle mutluluğu arayan Selma Hanım hep bu güçlü kadınlara örnektir. Bu parçada tanıtılan kahramanlardan yola çıkılarak aşağıdaki romanlardan hangisinden söz edilmediği söylenebilir?",Answer = "Sinekli Bakkal",ChoiceOne = "Vurun Kahpeye",ChoiceTwo = "Ateşten Gömlek",ChoiceThree = "Ankara",ChoiceFour = "Çalıkuşu",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Aruz ölçüsünü Türkçeye en iyi uygulayan bu iki şairimizin birinin yüzü Batı'ya, diğerininki Doğuya dönüktür. Biri, 'Sis' şiirinde uzaktan bakıp göremediği İstanbul’u bütün tarihi, toplumsal kurumları, yönetimi ve insanlarının suskunluğuyla geniş bir panoramada lanetler. Öteki, 'Seyfi Baba'da hasta dostunu ziyarete giderken elindeki kırık camlı fenerin kör ışığında geçtiği İstanbul sokaklarını betimler; yoksulluğu anlatır. Bu parçada karşılaştırılan şairler aşağıdakilerin hangisinde bir arada verilmiştir?",Answer = "Tevfik Fikret, Mehmet Âkif",ChoiceOne = "Yahya Kemal, Tevfik Fikret",ChoiceTwo = "Abdülhak Hamit, Cenap Şahabettin",ChoiceThree = "Mehmet Âkif, Mehmet Emin Yurdakul",ChoiceFour = "Ahmet Haşim, Faruk Nafiz Çamlıbel",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Atatürk'ü en net bilgilerle anlattığı Zeytindağı ve Çankaya adlı yapıtlarında, aynı zamanda içinde, yaşadığı dönemi de tanıtmıştır. Yapıtlarını sade bir üslupla ve çarpıcı sözcükleri seçerek oluşturmuştur. Gazeteciliğinin yanı sıra gezi yazılarıyla da tanınmıştır. Bu parçada sözü edilen sanatçı, aşağıdakilerin hangisidir?",Answer = "Falih Rıfkı Atay",ChoiceOne = "Yakup Kadri Karaosmanoğlu",ChoiceTwo = "Refik Halit Karay",ChoiceThree = "Halide Edip Adıvar",ChoiceFour = "Reşat Nuri Güntekin",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Bu iki yazarımızın 'sanatçı' olarak anılmalarında, Türkçeyi en yalın ve en duru anlatıma ulaştırmalarının payı büyüktür. Biri, anı, makale, söyleşi, gezi yazılarıyla ve gazeteciliğiyle; diğeri, deneme, eleştiri, söyleşi ve günceleriyle tanınır. Bu parçada sözü edilen yazarlar, aşağıdakilerden hangisinde bir arada verilmiştir?",Answer = "Falih Rıfkı Atay, Nurullah Ataç",ChoiceOne = "Ziya Gökalp, Nurullah Ataç",ChoiceTwo = "Falih Rıfkı Atay, Peyami Safa",ChoiceThree = "Refik Halit Karay, A. Hamdi Tanpınar",ChoiceFour = "Haldun Taner, Memduh Şevket",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Edebiyatımızda, realist, hatta natüralist anlayışa sahip, özellikle çirkin ve acı şeyleri gözler önüne seren; kötülüklerin yok olması, sorunların giderilmesi için önce bunların tüm açıklığıyla ortaya konması gerektiğine inanan sanatçılarımız vardır. Onlar, İstanbul'un kenar semtlerini, bütün memleket manzaralarını, halkı işleyen eserleriyle dikkat çekmişlerdir, Aşağıdakilerden hangisinde yukarıdaki anlayışla eser veren sanatçılar bir arada verilmiştir?",Answer = "Mehmet Âkif Ersoy – Hüseyin Rahmi Gürpınar",ChoiceOne = "Ömer Seyfettin – Yahya Kemal Beyatlı",ChoiceTwo = "Ahmet Haşim – Refik Halit Karay",ChoiceThree = "Ziya Gökalp – Yakup Kadri Karaosmanoğlu",ChoiceFour = "Ziya Gökalp – Ahmet Rasim",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Aşağıdaki eserlerden hangisi türü bakımından diğerlerinden farklıdır?",Answer = "Nur Baba",ChoiceOne = "Dağa Çıkan Kurt",ChoiceTwo = "Bir Serencam",ChoiceThree = "Gurbet Hikâyeleri",ChoiceFour = "Bahar ve Kelebekler",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="… Ahmet Celal'in köye geldikten sonra düşünceleri değişmiş; aydınları suçlamaya başlamıştır. Köyün, köylünün yaşayış ve inanışları, yerine göre abartma sayılacak boyutlarda betimlenip sergilenmiştir. Kimi zaman Ahmet Celal’in coşan veya iyice karamsarlığa varan duygulan, okuyucuya ürpertici uyanlarda bulunmaktadır. Yukarıdaki değerlendirme, aşağıdaki eserlerden hangisiyle ilgilidir?",Answer = "Yaban",ChoiceOne = "Sodom ve Gomore",ChoiceTwo = "Yeşil Gece",ChoiceThree = "Vurun Kahpeye",ChoiceFour = "Memleket Hikâyeleri",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="İyi yazılmış gezi yazılarını okurken siz de düş dünyanızda yolculuğa çıkarsınız. 'Seyahatname' ile önce Viyana'ya sonra Van'a gidiyorsunuz. 'Frankfurt Seyahatnamesi' ile Almanya'ya uzanıyorsunuz. 'Anadolu Notları' ile Anadolu'yu adım adım dolaşıyorsunuz. 'Bizim Akdeniz' ile ufkunuzu genişletiyorsunuz. Bu parçada yapıtı anılmayan sanatçı aşağıdakilerden hangisidir?",Answer = "Cenap Şahabettin",ChoiceOne = "Falih Rıfkı Atay",ChoiceTwo = "Reşat Nuri Güntekin",ChoiceThree = "Ahmet Haşim",ChoiceFour = "Evliya Çelebi",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Aşağıdakilerden hangisi Tanzimat Fermanı’nın ilan edilme nedenlerinden biri değildir?",Answer = "Avrupa’yı yakından gören aydınların Osmanlı devlet yönetiminden memnun olmaması",ChoiceOne = "Nizam-ı Cedit adıyla bilinen ve yaklaşık yüz yıl önce başlamış olan Batılılaşma projesinin resmî devlet görüşüne dönüştürülmek istenmesi",ChoiceTwo = "Hukuk alanında çağdaş düzenlemelere gidilerek devlet yapısının çağdaşlaşmasının amaçlanması",ChoiceThree = "Mısır ve Boğazlar konusunda Avrupalı devletlerin desteğinin alınmak istenmesi",ChoiceFour = "Fransız İhtilali’nin milliyetçi etkisinin azaltılarak gayrimüslimlerin Osmanlı Devleti’ne bağlamaya çalışılması",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Aşağıdakilerden hangisinde bir bilgi yanlışı vardır?",Answer = "Osmanlı devlet yönetiminde padişahtan sonra halk tabakası, zanaatçılar, askerler ve en son da ilim adamları söz sahibidir.",ChoiceOne = "Osmanlı Devleti’nin gerilemesi devlet yapısındaki bozulmadan, sosyal düzendeki çözülmeden kaynaklanmıştır.",ChoiceTwo = "Osmanlı Devleti merkeziyetçi bir yapıya sahip olmuş; toplum, yönetenler ve yönetilenler olarak ikiye ayrılmıştır.",ChoiceThree = "Osmanlı toplumunda sosyal düzen merkezi otorite çevresinde sağlanmıştır.",ChoiceFour = "Padişah, Allah’ın gölgesi kabul edilmiş (zıllullah) ve toplumu temsil eden piramidin en üst noktasında yer almıştır.",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
                new Question(){Title="Tanzimat öncesi zihniyet yapısıyla ilgili aşağıdakilerden hangisi yanlıştır?",Answer = "Avrupa ile ilişkilerin artmasıyla farklı bir anlayışa sahip yeni bir nesil ortaya çıkmıştır.",ChoiceOne = "Hem yönetimde hem toplumsal yaşamda din belirleyici öge olmuştur.",ChoiceTwo = "Padişahın belirli kararlarında şeyhülislam etkili olmuştur.",ChoiceThree = "Aile düzeni, inanç ve geleneklere göre şekillenmiştir.",ChoiceFour = "İslam dininin kuralları toplumsal yaşamda kendini göstermiştir.",AddedTime = DateTime.Now,CategoryId = 5,TeacherId = 1,Picture = null},
