                new Question(){Title="Türk Kurtuluş Savaşı'nın kazanılmasında; I. Temsil Heyeti II. İstanbul Hükümeti III. Müdafaa-i Hukuk Cemiyetleri hangilerinin rolü olduğu söylenebilir?",Answer = "I ve III",ChoiceOne = "Yalnız III",ChoiceTwo = "Yalnız II",ChoiceThree = "Yalnız II",ChoiceFour = "I, II ve III",AddedTime = DateTime.Now,CategoryId = 6,TeacherId = 1,Picture = null},
