                new Question(){Title="Aşağıdakiierden hangisi, İtilaf Devletleri'nin 'Milli İradeyi' tanımadıklarını ve saygılı ol­madıklarını göstermektedir?",Answer = "Mebusan Meclisi'ni basarak dağıtmaları",ChoiceOne = "Sivas Kongresi'ni engellemeleri",ChoiceTwo = "Kuvayı Milliye'yi tanımamaları",ChoiceThree = "İç İsyanları desteklemeleri",ChoiceFour = "İstanbul Hükümeti ile iş birliği yapmaları",AddedTime = DateTime.Now,CategoryId = 6,TeacherId = 1,Picture = null},
                new Question(){Title="12 Ocak 1920’de Osmanlı Mebusan Meclisi toplandı. Meclis daha önce Mustafa Kemal tarafından planlanan işlerin büyük bölümünü yerine getirmedi. Müdafaa-i Hukuk Grubu kurulmadığı gibi Mustafa Kemal de Meclis başkanlığına seçilmedi. Mebuslar Meclisi üyelerinin bu davranışları ile aşağıdakilerden hangisini amaçladıkları söylenebilir?",Answer = "Anadolu hareketinin emrinde olmadıklarını kanıtlamak",ChoiceOne = "İtilaf Devletleri’yle işbirliği içinde olduklarını göstermek",ChoiceTwo = "Kuva-i Milliye hareketiyle birlikte olduklarını göstermek",ChoiceThree = "Padişahın baskısı altında olmadıklarını açıklamak",ChoiceFour = "Ulusal bir meclis olduklarını kanıtlamak",AddedTime = DateTime.Now,CategoryId = 6,TeacherId = 1,Picture = null},
                new Question(){Title="Osmanlı Mebuslar Meclisi tarafından onaylanan Misak-ı Milli’de; “Her devlet gibi bizim de tam bağımsızlığa ve serbestliğe ihtiyacımız vardır. Bu yaşamamızın ve geleceğimizin esasıdır, bu nedenle siyasi, adli ve mali gelişmemizi önleyecek sınırlamalara karşıyız.” denilmiştir. Bu karar ile aşağıdakilerden hangisi savunulmaktadır?",Answer = "Kapitülasyonların kaldırılması",ChoiceOne = "Padişahın güvenliğinin sağlanması",ChoiceTwo = "Mondros Ateşkesi hükümlerine uyulması",ChoiceThree = "Savaş durumuna son verilmesi",ChoiceFour = "Azınlık haklarının korunması",AddedTime = DateTime.Now,CategoryId = 6,TeacherId = 1,Picture = null},
                new Question(){Title="TBMM’nin Kurtuluş Savaşı’nın sonuna kadar düzenli çalışmasını ve süratli karar almasını sağlayan özelliği aşağıdakilerden hangisidir?",Answer = "Ülke yönetimini elinde bulunduran tek organ olması",ChoiceOne = "Dış ilişkilerinde güçlü olma ilkesini benimsemesi",ChoiceTwo = "Ayaklanmaları bastırması",ChoiceThree = "Kurduğu hükümeti devam ettirmesi",ChoiceFour = "Laik düzene geçmeyi amaçlaması",AddedTime = DateTime.Now,CategoryId = 6,TeacherId = 1,Picture = null},
                new Question(){Title="Misak-ı Milli’de; Kars, Ardahan ve Batum’da halkoylaması yapılması isteniyordu. Bu bölgelerde halk oylaması yapılmasının istenmesinde; I. Wilson İlkeleri II. Türk nüfusun çoğunlukta olması III. Mondros Ateşkes Antlaşması’nın imzalanması IV. Brest-Litowsk Antlaşması V. Osmanlı ordusunun terhis edilmesi gibi durumlardan hangilerinin etkili olduğu savunulabilir?",Answer = "I, II ve IV",ChoiceOne = "I, III ve V",ChoiceTwo = "I, II ve V",ChoiceThree = "III, IV ve V",ChoiceFour = "II, IV ve V",AddedTime = DateTime.Now,CategoryId = 6,TeacherId = 1,Picture = null},
